import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { instituteAPI } from '../../services/api';
import './UserPanel.css';

const InstituteList = () => {
  const [institutes, setInstitutes] = useState([]);
  const [filteredInstitutes, setFilteredInstitutes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [filters, setFilters] = useState({
    category: '',
    city: '',
    minFees: '',
    maxFees: '',
    minRating: '',
    facilities: []
  });

  const categories = ['school', 'college', 'coaching', 'preschool', 'university'];
  const cities = ['Mumbai', 'Delhi', 'Bangalore', 'Chennai', 'Kolkata', 'Hyderabad', 'Pune'];
  const facilitiesList = ['Library', 'Sports', 'Lab', 'Hostel', 'Cafeteria', 'Transport'];

  useEffect(() => {
    fetchInstitutes();
  }, []);

  useEffect(() => {
    applyFilters();
  }, [institutes, filters, searchTerm]);

  const fetchInstitutes = async () => {
    try {
      const response = await instituteAPI.getAll();
      setInstitutes(response.data);
      setFilteredInstitutes(response.data);
    } catch (error) {
      console.error('Error fetching institutes:', error);
    } finally {
      setLoading(false);
    }
  };

  const applyFilters = () => {
    let filtered = institutes;

    // Search filter
    if (searchTerm) {
      filtered = filtered.filter(institute =>
        institute.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        institute.city.toLowerCase().includes(searchTerm.toLowerCase()) ||
        institute.category.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    // Category filter
    if (filters.category) {
      filtered = filtered.filter(institute => institute.category === filters.category);
    }

    // City filter
    if (filters.city) {
      filtered = filtered.filter(institute => 
        institute.city.toLowerCase().includes(filters.city.toLowerCase())
      );
    }

    // Rating filter
    if (filters.minRating) {
      // In real implementation, you'd calculate average rating
      filtered = filtered.filter(institute => {
        // Mock rating calculation
        const mockRating = Math.floor(Math.random() * 3) + 3; // 3-5 stars for demo
        return mockRating >= parseFloat(filters.minRating);
      });
    }

    // Fees filter
    if (filters.minFees || filters.maxFees) {
      filtered = filtered.filter(institute => {
        const courseFees = institute.courses?.map(course => course.fees) || [0];
        const minCourseFee = Math.min(...courseFees);
        const maxCourseFee = Math.max(...courseFees);

        if (filters.minFees && filters.maxFees) {
          return minCourseFee >= parseFloat(filters.minFees) && maxCourseFee <= parseFloat(filters.maxFees);
        } else if (filters.minFees) {
          return minCourseFee >= parseFloat(filters.minFees);
        } else if (filters.maxFees) {
          return maxCourseFee <= parseFloat(filters.maxFees);
        }
        return true;
      });
    }

    // Facilities filter
    if (filters.facilities.length > 0) {
      filtered = filtered.filter(institute =>
        filters.facilities.every(facility =>
          institute.facilities?.includes(facility)
        )
      );
    }

    setFilteredInstitutes(filtered);
  };

  const handleFilterChange = (key, value) => {
    setFilters(prev => ({
      ...prev,
      [key]: value
    }));
  };

  const handleFacilityToggle = (facility) => {
    setFilters(prev => ({
      ...prev,
      facilities: prev.facilities.includes(facility)
        ? prev.facilities.filter(f => f !== facility)
        : [...prev.facilities, facility]
    }));
  };

  const clearFilters = () => {
    setFilters({
      category: '',
      city: '',
      minFees: '',
      maxFees: '',
      minRating: '',
      facilities: []
    });
    setSearchTerm('');
  };

  const getInstituteRating = (institute) => {
    // Mock rating - in real app, calculate from reviews
    return (Math.random() * 2 + 3).toFixed(1); // 3.0 - 5.0
  };

  if (loading) {
    return <div className="loading">Loading institutes...</div>;
  }

  return (
    <div className="institute-list-page">
      <div className="page-header">
        <h1>Find Educational Institutes</h1>
        <p>Discover the best schools, colleges, and coaching centers</p>
      </div>

      <div className="search-filters-container">
        {/* Search Bar */}
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search by name, city, or category..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <button className="search-btn">üîç</button>
        </div>

        {/* Filters */}
        <div className="filters-section">
          <div className="filter-group">
            <label>Category</label>
            <select
              value={filters.category}
              onChange={(e) => handleFilterChange('category', e.target.value)}
            >
              <option value="">All Categories</option>
              {categories.map(category => (
                <option key={category} value={category}>
                  {category.charAt(0).toUpperCase() + category.slice(1)}
                </option>
              ))}
            </select>
          </div>

          <div className="filter-group">
            <label>City</label>
            <select
              value={filters.city}
              onChange={(e) => handleFilterChange('city', e.target.value)}
            >
              <option value="">All Cities</option>
              {cities.map(city => (
                <option key={city} value={city}>{city}</option>
              ))}
            </select>
          </div>

          <div className="filter-group">
            <label>Min Rating</label>
            <select
              value={filters.minRating}
              onChange={(e) => handleFilterChange('minRating', e.target.value)}
            >
              <option value="">Any Rating</option>
              <option value="4">4+ Stars</option>
              <option value="3">3+ Stars</option>
              <option value="2">2+ Stars</option>
            </select>
          </div>

          <div className="filter-group">
            <label>Min Fees (‚Çπ)</label>
            <input
              type="number"
              placeholder="Min"
              value={filters.minFees}
              onChange={(e) => handleFilterChange('minFees', e.target.value)}
            />
          </div>

          <div className="filter-group">
            <label>Max Fees (‚Çπ)</label>
            <input
              type="number"
              placeholder="Max"
              value={filters.maxFees}
              onChange={(e) => handleFilterChange('maxFees', e.target.value)}
            />
          </div>

          <button onClick={clearFilters} className="clear-filters">
            Clear All
          </button>
        </div>

        {/* Facilities Filter */}
        <div className="facilities-filter">
          <label>Facilities:</label>
          <div className="facilities-options">
            {facilitiesList.map(facility => (
              <label key={facility} className="facility-option">
                <input
                  type="checkbox"
                  checked={filters.facilities.includes(facility)}
                  onChange={() => handleFacilityToggle(facility)}
                />
                <span>{facility}</span>
              </label>
            ))}
          </div>
        </div>
      </div>

      {/* Results */}
      <div className="results-section">
        <div className="results-header">
          <h2>
            {filteredInstitutes.length} Institute{filteredInstitutes.length !== 1 ? 's' : ''} Found
          </h2>
          <div className="sort-options">
            <select>
              <option>Sort by: Relevance</option>
              <option>Sort by: Rating</option>
              <option>Sort by: Fees</option>
            </select>
          </div>
        </div>

        {filteredInstitutes.length === 0 ? (
          <div className="no-results">
            <div className="no-results-icon">üîç</div>
            <h3>No institutes found</h3>
            <p>Try adjusting your search criteria or filters</p>
            <button onClick={clearFilters} className="btn-primary">
              Clear All Filters
            </button>
          </div>
        ) : (
          <div className="institutes-grid">
            {filteredInstitutes.map(institute => (
              <div key={institute._id} className="institute-card">
                <div className="card-image">
                  {institute.images && institute.images.length > 0 ? (
                    <img src={institute.images[0]} alt={institute.name} />
                  ) : (
                    <div className="no-image">üè´</div>
                  )}
                  <div className="card-badge">
                    {institute.category.charAt(0).toUpperCase() + institute.category.slice(1)}
                  </div>
                </div>

                <div className="card-content">
                  <div className="card-header">
                    <h3>{institute.name}</h3>
                    <div className="rating">
                      <span className="stars">‚≠ê {getInstituteRating(institute)}</span>
                    </div>
                  </div>

                  <div className="card-location">
                    <span>üìç {institute.city}, {institute.state}</span>
                  </div>

                  <div className="card-affiliation">
                    <span>üèõÔ∏è {institute.affiliation}</span>
                  </div>

                  {institute.facilities && institute.facilities.length > 0 && (
                    <div className="card-facilities">
                      <div className="facilities-tags">
                        {institute.facilities.slice(0, 3).map((facility, index) => (
                          <span key={index} className="facility-tag">{facility}</span>
                        ))}
                        {institute.facilities.length > 3 && (
                          <span className="more-facilities">
                            +{institute.facilities.length - 3} more
                          </span>
                        )}
                      </div>
                    </div>
                  )}

                  {institute.courses && institute.courses.length > 0 && (
                    <div className="card-courses">
                      <span>üìö {institute.courses.length} courses available</span>
                    </div>
                  )}
                </div>

                <div className="card-actions">
                  <Link to={`/institute/${institute._id}`} className="btn-primary">
                    View Details
                  </Link>
                  <button className="btn-secondary">
                    ‚≠ê Review
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default InstituteList;
